$.fn.moveIt=function(){var t=$(window),o=[];$(this).each(function(){o.push(new moveItItem($(this)))}),window.onscroll=function(){var e=t.scrollTop();o.forEach(function(t){t.update(e)})}};var moveItItem=function(t){this.el=$(t),this.speed=parseInt(this.el.attr("data-scroll-speed"))};moveItItem.prototype.update=function(t){var e=t/this.speed;this.el.css("transform","translateY("+-e+"px)")},$(function(){$("[data-scroll-speed]").moveIt()});